import * as React from "react";
import Box from "@material-ui/core/Box";
import Stepper from "@material-ui/core/Stepper";
import Step from "@material-ui/core/Step";
import StepLabel from "@material-ui/core/StepLabel";
import styled from "styled-components";
import Information from "../driver/information";
import PhoneVerification from "../driver/phone-verification";
import LastPage from "../driver/finish";
import {CustomButton} from "../../elements";

const Container = styled('div')`
padding-bottom:30px;
`;

const CodeSentContainer = styled('div')`
display:flex;
justify-content:center;
`;

const CodeSentText = styled('p')`
font-family: Open Sans;
font-style: normal;
font-weight: 600;
font-size: 16px;
line-height: 22px;
text-align: center;
color: #20AA46;
padding-left:15px;
`;

const FixedCustomButton = styled(CustomButton)`
margin-bottom:0px;
`;
const ModalTitle = styled("p")`
font-family: Open Sans;
font-style: normal;
font-weight: 600;
font-size: 16px;
line-height: 22px;
text-align: center;
`;
const BackButton = styled("img")`
padding-bottom:10px;
`;

const InfoText = styled("p")`
font-family: Open Sans;
font-style: normal;
font-weight: normal;
font-size: 12px;
line-height: 16px;
text-align: center;
color: #444444;
padding-top:10px;
padding-bottom:20px;
`;

const CustomFlexContainer = styled(FlexContainer)`
padding-bottom:0px;
justify-content: center;
}
`;

const StepperContainer = styled("div")`
width:760px;
margin:auto;
`;
const steps = [
  "Driver Information",
  "Phone Verification",
  "Vehicle Type",
  "Documents"
];

export default function HorizontalLinearStepper() {
  const [activeStep, setActiveStep] = React.useState(0);
  const [skipped, setSkipped] = React.useState(new Set());
  const [show, setShow] = React.useState(false);
  const [sendSms, setSendTextShow] = React.useState(false);

  const isStepOptional = (step) => {
    return step === 1;
  };

  const isStepSkipped = (step) => {
    return skipped.has(step);
  };

  const handleNext = () => {
    let newSkipped = skipped;
    if (isStepSkipped(activeStep)) {
      newSkipped = new Set(newSkipped.values());
      newSkipped.delete(activeStep);
    }

    setActiveStep((prevActiveStep) => prevActiveStep + 1);
    setSkipped(newSkipped);
  };

  const handleBack = () => {
    setActiveStep((prevActiveStep) => prevActiveStep - 1);
  };

  const handleSkip = () => {
    if (!isStepOptional(activeStep)) {
      // You probably want to guard against something like this,
      // it should never occur unless someone's actively trying to break something.
      throw new Error("You can't skip a step that isn't optional.");
    }

    setActiveStep((prevActiveStep) => prevActiveStep + 1);
    setSkipped((prevSkipped) => {
      const newSkipped = new Set(prevSkipped.values());
      newSkipped.add(activeStep);
      return newSkipped;
    });
  };

  const handleReset = () => {
    setActiveStep(0);
  };


  return (
    <StepperContainer>
      <Stepper activeStep={activeStep} alternativeLabel>
        {steps.map((label, index) => {
          const stepProps = {};
          const labelProps = {};

          return (
            <Step key={label} {...stepProps}>
              <StepLabel {...labelProps}>{label}</StepLabel>
            </Step>
          );
        })}
      </Stepper>
      {
        activeStep === steps.length ? <LastPage /> :
          activeStep == 0 ?
            <Information activeStep={activeStep} steps={steps} handleNext={handleNext} /> :

            <PhoneVerification  setShow={setShow} handleNext={handleNext} handleBack={handleBack} />

      }

      <Modal onClose={() => setShow(false)} show={show}>
        <Container>
          <ModalTitle>We will resend code to +251 911 39 96 31</ModalTitle>
        </Container>
        <FixedCustomButton onClick={() => { setShow(false); setSendTextShow(true); }}>Text me</FixedCustomButton>
      </Modal>

      <Modal onClose={() => setSendTextShow(false)} show={sendSms}>
        <Container>
          <ModalTitle>We have sent 6 digit code to +251 911 39 96 31</ModalTitle>
          <InfoText>please check your inbox</InfoText>
          <CodeSentContainer>
            <img src={require("../../../../assets/icons/checked.svg")}></img>
            <CodeSentText> Code sent</CodeSentText>
          </CodeSentContainer>
        </Container>
        <FixedCustomButton onClick={() => setSendTextShow(false)}>Done</FixedCustomButton>
      </Modal>
    </StepperContainer>

  );
}
